import React from "react";


// Component to spit out agent information
class AgentInfo extends React.Component {

  // Construct so it takes properties and they are information
  constructor(props) {
    super(props);
    this.state = {
      agent_id: props.agent_id,
      cur_angle: props.cur_angle,
      cur_pos: props.cur_pos,
      color: props.color,
    };
  }

  // Render the information to screen
  render() {
    return (
      <div style={{
            backgroundColor: '{this.props.color}',
      }}>
          {/* HTML FOR ALL THE INFORMATION */}
          <p> Agent: {this.props.agent_id} </p>
          <p> Current Angle: {this.props.cur_angle} </p>
          <p> Current Pos: {this.props.cur_pos} </p>
          <p> Color: {this.props.color} </p>
      </div>
      );
    }
}


export default AgentInfo;
